function compareTime(data, curYear, curMonth, curDay, timeObj) {
  if (!timeObj)
    return (
      data.year < curYear ||
      (data.year === curYear && data.month <= curMonth && data.day <= curDay)
    );
  else
    return (
      data.year < timeObj.getFullYear() ||
      (data.year === curYear && data.month <= curMonth && data.day <= curDay)
    );
}

export default compareTime;
